import React, { Component } from "react";
import "./NotableSideBar.css";

export class NotableSideBar extends Component {
  render() {
    const { physicians, current } = this.props;
    console.log("HEY", physicians);
    return (
      <div className="NotableSideBar">
        <div>NOTABLE</div>
        <div>PHYSICIANS</div>
        {
          <ul>
            {physicians.map((physician, i) => (
              <li key={i + 1}>
                {physician.firstName} {physician.lastName}
              </li>
            ))}
          </ul>
        }
      </div>
    );
  }
}

export default NotableSideBar;
